import Link from 'next/link'
import React from 'react'

type Props = {}

const Header = (props: Props) => {
    const menu=[
        {
            name:"home",
            href:"/home"
        },
        {
            name:"users",
            href:"/user"
        }
    ]
  return (
    <header className='w-full p-8 flex justify-end bg-amber-500'>
        <nav>
            <menu>
                {menu.map((item, i)=>(
                    <li key={i}>
                        <Link href={item.href}>{item.name.toUpperCase()}</Link>
                    </li>
                ))}
            </menu>
        </nav>

    </header>
  )
}

export default Header
